-- 设置客户端连接字符集
SET NAMES utf8mb4;
SET CHARACTER SET utf8mb4;
SET character_set_client = utf8mb4;
SET character_set_connection = utf8mb4;
SET character_set_results = utf8mb4;

CREATE DATABASE IF NOT EXISTS KMMOM CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

USE KMMOM;

CREATE TABLE IF NOT EXISTS KMMOM.MOM_WORK_CENTER (
    CID BIGINT NOT NULL COMMENT '对象',
    CENTITY_TYPE VARCHAR(256) NULL COMMENT '实体类型',
    CCREATOR_ID BIGINT NULL COMMENT '创建者ID',
    CCREATOR_ENTITY_TYPE VARCHAR(256) NULL COMMENT '',
    CCREATE_TIME TIMESTAMP NULL COMMENT '创建时间',
    CMODIFIER_ID BIGINT NULL COMMENT '修改者ID',
    CMODIFIER_ENTITY_TYPE VARCHAR(256) NULL COMMENT '',
    CLATEST_UPDATE_TIME TIMESTAMP NULL COMMENT '最近修改时间',
    CSOFT_DELETE_FLAG INT NULL COMMENT '软删除标记',
    CENV VARCHAR(80) NULL COMMENT '环境标识',
    CCODE VARCHAR(512) NULL COMMENT '编码',
    CNAME VARCHAR(512) NULL COMMENT '名称',
    CREMARK VARCHAR(1024) NULL COMMENT '备注',
    CSECURITY_LEVEL VARCHAR(256) NULL COMMENT '密级',
    CWORK_CENTER_TYPE VARCHAR(256) NULL COMMENT '类型:[WW:外委,XZ:小组,RY:人员,SB:设备,CX:产线,GD:工段,GC:工厂,CJ:车间]',
    CBIZ_ORG_ID BIGINT NULL COMMENT '工厂组织ID',
    CBIZ_ORG_ENTITY_TYPE VARCHAR(256) NULL COMMENT '',
    CFACTORY_ID BIGINT NULL COMMENT '所属工厂ID',
    CFACTORY_ENTITY_TYPE VARCHAR(256) NULL COMMENT '',
    CWORK_CENTER_CATEGORY VARCHAR(256) NULL COMMENT '分类:[ZP:装配,JG:加工,JY:检验,TYSC:通用生产]',
    CDISTRIBUTION_POINT_ID BIGINT NULL COMMENT '',
    CDISTRIBUTION_POINT_ENTITY_TYPE VARCHAR(256) NULL COMMENT '',
    PRIMARY KEY (CID)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='工作中心';

-- 创建唯一索引
CREATE UNIQUE INDEX idx_mom_work_center_cid ON KMMOM.MOM_WORK_CENTER (CID);

